  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer portrays the State boundaries
  of the United States, and the boundaries of Puerto Rico and the U.S. Virgin Islands.
  The map layer was created by extracting the State boundary polygons from the individual
  1:2,000,000-scale State boundary Digital Line Graph (DLG) files produced by the
  U.S. Geological Survey. These files were then merged into a single coverage. This
  is an updated version of the June 2002 map layer; the date when each State was admitted
  to the United States was added.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
